import React, { useState } from 'react'

import { FaPeopleCarry, FaLaptopCode, FaShuttleVan, FaAngular } from "react-icons/fa"


//import from services css
import './Technologies.css'

function Services() {


    const [state,setState] = useState({
        technolo: [
            {
                icon: <FaPeopleCarry />,
                title: "Front End",
                info: 'Hey are you looking for people during busy time find out here.'

            },
            {
                icon: <FaLaptopCode />,
                title: "website development",
                info: 'Coming Soon...................'

            },
            {
                icon: <FaShuttleVan />,
                title: "IT consultant",
                info: 'Coming Soon...................'

            },
            {
                icon: <FaAngular />,
                title: "web development course",
                info: 'Coming Soon...................'

            },
        ]

    })
    return (
        <section className="services">
            <h1>Technical Proficiencies</h1>
            <div className="services-center">
                {state.services.map((item, index) => {
                    return (
                        <article key={index} className="services">
                            <span>{item.icon}</span>
                            <h2>{item.title}</h2>
                            <p>{item.info}</p>
                        </article>
                    );

                })}
            </div>
        </section>



    );
}


export default Services
